import {  Col, Row } from 'react-bootstrap';
import icone_email from '../Componentes/imgs/email.png';


export default function Contatos()  {
    return (
        <div>
            <h1 className="my-5">Fale Conosco</h1>
            <Row >
                <Col className="mx-auto">
                    <img src="../imgs/email.png" width="50px" alt="ícone de e-mail"/>
                    contato@fullstackeletro.com  
                </Col>
                <Col className="mx-auto">
                    <img src="../imgs/wpp.jpg" width="50px" alt="ícone do whatsapp"/>
                    (11) 99999-9999  
                </Col>
            </Row>
        </div>

    );
}
